import "./Login.css";
import React, { Component } from "react";
import { Container, Form, Row, Button, Card } from "react-bootstrap";
import { CardContent, Typography } from "@material-ui/core";

class Login extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      email: "",
      password: "",
    };
  }

  render() {
    return (
      <Container fluid style={{ backgroundColor: "#f3f2ef" }}>
        <Row>
          <img
            className="linkedin-img rounded mx-auto d-block"
            src="https://www.logo.wine/a/logo/LinkedIn/LinkedIn-Logo.wine.svg"
            alt="linkedin logo"
          />
        </Row>
        <Typography align="center" variant="h5" style={{ marginTop: "-100px" }}>
          Make the most of your professional life
        </Typography>
        <Row
          style={{
            display: "flex",
            justifyContent: "center",
            marginTop: "30px",
            paddingBottom: "10%",
          }}
        >
          <Card className="p-3">
            <Form>
              <Form.Group controlId="formBasicEmail">
                <Form.Label>Email address</Form.Label>
                <Form.Control size="sm" type="email" placeholder="Enter email" />
                <Form.Text className="text-muted">
                  We'll never share your email with anyone else.
                </Form.Text>
              </Form.Group>

              <Form.Group controlId="formBasicPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
              </Form.Group>
              <Form.Group controlId="formBasicCheckbox">
                <Form.Check type="checkbox" label="Check me out" />
              </Form.Group>
              <Button variant="primary" type="submit">
                Submit
              </Button>
            </Form>
          </Card>
        </Row>
      </Container>
    );
  }
}

export default Login;
